import React from 'react';

const App = () => {
    const apiKey = process.env.REACT_APP_API_KEY;
    const apiUrl = process.env.REACT_APP_API_URL;

    return (
        <div>
            <h1>Environment Variables</h1>
            <p>API Key: {apiKey}</p>
            <p>API URL: {apiUrl}</p>
        </div>
    );
};

export default App;
